import React, { Component } from "react";
import { db } from "../index";
import { MDBContainer, MDBFooter, MDBRow, MDBCol } from "mdbreact";
import { Container } from "side-navigation-react";
import FeedBackTable from './Components/FeedBackTable.js'
class FeedBackMangement extends Component {
  state = {
    feedBack: [],
  };
  componentDidMount() {
    db.collection("FeedBack")
      .get()
      .then((querySnapshot) => {
        querySnapshot.forEach((item, index) => {
          this.setState({
            feedBack: [...this.state.feedBack, item],
          });
        });
        console.log(this.state.feedBack);
      });
  }

  render() {
    return (
      <MDBContainer>
      <FeedBackTable feedBack  = {this.state.feedBack} />
      </MDBContainer>
    );
  }
}

export default FeedBackMangement;
